import "./Aboutus.css"
function Aboutus({close}) {
  return <div className='About'>
      <div className='Aboutbox'>
      <div><h1>ABOUT-US</h1></div>
      <h></h>
      <div className='closeAboutUs' onClick={close}><img src='/images/No.png'/></div>
      <div></div>
      <input type="text"/>
      </div>
  </div>;
}

export default Aboutus;
